export const FriendList = ({ friends }) => {
    return (
        <ul class="friend-list">
            {friends.map(({avatar, name, isOnline, id}) => {
                <FriendListItem
                    avatar={avatar}
                    name={name}
                    isOnline={isOnline}
                    key={id} />
            })}

</ul>)
}
